import React, { useState, useEffect } from 'react';
import {
    AppBar,
    Toolbar,
    Typography,
    Button,
    Container,
    Box,
    TextField,
    Paper,
    MenuItem,
    Select,
    FormControl,
    InputLabel,
} from '@mui/material';
import axios from '../utils/axiosConfig';
import { useNavigate } from 'react-router-dom';
import { toast } from 'react-toastify';

const Home = () => {
    const [file, setFile] = useState(null);
    const [fileType, setFileType] = useState('csv'); // Default file type
    const [datasetExists, setDatasetExists] = useState(false); // Check if a dataset already exists
    const navigate = useNavigate();

    useEffect(() => {
        // Check if the user already has an uploaded dataset
        const checkDatasetStatus = async () => {
            try {
                const response = await axios.get('/dataset-status', {
                    headers: { Authorization: `Bearer ${localStorage.getItem('token')}` },
                });
                setDatasetExists(response.data.datasetExists || false);
            } catch (error) {
                console.error('Error checking dataset status:', error);
                toast.error('Failed to check dataset status');
            }
        };

        checkDatasetStatus();
    }, []);

    const handleLogout = () => {
        toast.info('You have been logged out!');
        navigate('/login');
    };

    const handleFileUpload = async () => {
        if (!file) {
            toast.warning('Please select a dataset to upload.');
            return;
        }

        if (!fileType) {
            toast.warning('Please select the file type.');
            return;
        }

        const formData = new FormData();
        formData.append('file', file);
        formData.append('file_type', fileType);

        try {
            const response = await axios.post('/home', formData, {
                headers: { 'Content-Type': 'multipart/form-data' },
            });
            toast.success(response.data.message || 'File uploaded successfully!');
            navigate('/chat'); // Redirect to chat page
        } catch (error) {
            console.error('Upload failed:', error);
            toast.error(error.response?.data?.message || 'Upload failed');
        }
    };

    const handleReplaceDataset = async () => {
        if (!file) {
            toast.warning('Please select a new dataset to replace.');
            return;
        }

        if (!fileType) {
            toast.warning('Please select the file type.');
            return;
        }

        const formData = new FormData();
        formData.append('file', file);
        formData.append('file_type', fileType);

        try {
            const response = await axios.post('/replace', formData, {
                headers: { 'Content-Type': 'multipart/form-data' },
            });
            toast.success(response.data.message || 'Dataset replaced successfully!');
            navigate('/chat'); // Redirect to chat page
        } catch (error) {
            console.error('Replace failed:', error);
            toast.error(error.response?.data?.message || 'Failed to replace dataset');
        }
    };

    const handleContinueToChat = () => {
        navigate('/chat'); // Navigate to chat with existing dataset
    };

    return (
        <>
            {/* Navigation Bar */}
            <AppBar position="sticky" sx={{ mb: 4, bgcolor: '#d32f2f', boxShadow: 2 }}>
                <Toolbar>
                    <Typography variant="h6" sx={{ flexGrow: 1, color: '#fff' }}>
                        MyApp
                    </Typography>
                    <Button color="inherit" onClick={() => navigate('/home')} sx={{ textTransform: 'none' }}>
                        Home
                    </Button>
                    <Button color="inherit" onClick={handleLogout} sx={{ textTransform: 'none' }}>
                        Logout
                    </Button>
                </Toolbar>
            </AppBar>

            {/* Main Content */}
            <Container
                sx={{
                    height: 'calc(100vh - 64px)', // Subtract navbar height
                    display: 'flex',
                    justifyContent: 'center',
                    alignItems: 'center',
                    backgroundColor: '#ffebc5', // Light yellow background
                }}
            >
                <Paper
                    elevation={6}
                    sx={{
                        padding: 4,
                        borderRadius: 2,
                        width: '100%',
                        maxWidth: 500,
                        textAlign: 'center',
                        backgroundColor: '#fff3e0', // Light orange for the paper
                        boxShadow: 3,
                    }}
                >
                    <Typography variant="h5" gutterBottom sx={{ color: '#d32f2f', fontWeight: '600' }}>
                        {datasetExists ? 'Manage Your Dataset' : 'Upload Your Dataset'}
                    </Typography>

                    {datasetExists ? (
                        <>
                            <Button
                                variant="contained"
                                color="primary"
                                fullWidth
                                size="large"
                                onClick={handleContinueToChat}
                                sx={{
                                    textTransform: 'none',
                                    fontWeight: 'bold',
                                    mb: 2,
                                    borderRadius: 2,
                                    boxShadow: 3,
                                    '&:hover': {
                                        backgroundColor: '#b71c1c',
                                        boxShadow: 5,
                                    },
                                }}
                            >
                                Continue to Chat
                            </Button>
                            <Typography variant="body2" gutterBottom sx={{ color: '#d32f2f', fontWeight: '600' }}>
                                Or replace the existing dataset:
                            </Typography>
                        </>
                    ) : null}

                    <Box sx={{ mt: 3, mb: 2 }}>
                        <TextField
                            type="file"
                            fullWidth
                            inputProps={{
                                onChange: (e) => setFile(e.target.files[0]),
                            }}
                            sx={{
                                backgroundColor: '#fff',
                                borderRadius: 1,
                                '& input': {
                                    color: '#000', // Adjust text color for file input
                                },
                            }}
                        />
                    </Box>
                    <FormControl fullWidth sx={{ mb: 2, backgroundColor: '#fff', borderRadius: 1 }}>
                        <InputLabel id="file-type-label" sx={{ color: '#d32f2f' }}>
                            File Type
                        </InputLabel>
                        <Select
                            labelId="file-type-label"
                            value={fileType}
                            onChange={(e) => setFileType(e.target.value)}
                            fullWidth
                            sx={{
                                color: '#000',
                                '& .MuiOutlinedInput-notchedOutline': {
                                    borderColor: '#d32f2f',
                                },
                                '&:hover .MuiOutlinedInput-notchedOutline': {
                                    borderColor: '#c2185b',
                                },
                            }}
                        >
                            <MenuItem value="csv">CSV</MenuItem>
                            <MenuItem value="tsv">TSV</MenuItem>
                        </Select>
                    </FormControl>
                    <Button
                        variant="contained"
                        color="error"
                        fullWidth
                        size="large"
                        onClick={datasetExists ? handleReplaceDataset : handleFileUpload}
                        sx={{
                            textTransform: 'none',
                            fontWeight: 'bold',
                            borderRadius: 2,
                            boxShadow: 3,
                            '&:hover': {
                                backgroundColor: '#b71c1c',
                                boxShadow: 5,
                            },
                        }}
                    >
                        {datasetExists ? 'Replace Dataset' : 'Upload Dataset'}
                    </Button>
                </Paper>
            </Container>
        </>
    );
};

export default Home;
